-- ----------------------------
-- Table structure for `t_wxcms_user_comm_task`
-- ----------------------------
DROP TABLE IF EXISTS `t_wxcms_user_comm_task`;
CREATE TABLE `t_wxcms_user_comm_task` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '任务发布人',
  `task_title` varchar(200) NOT NULL,
  `task_content` varbinary(50000) DEFAULT NULL,
  `task_status` int(4) NOT NULL DEFAULT '0' COMMENT '任务审核状态',
  `task_total_num` int(12) NOT NULL DEFAULT '0' COMMENT '任务数量',
  `task_accept_num` int(12) NOT NULL DEFAULT '0' COMMENT '任务被接的数量',
  `task_finished_num` int(12) NOT NULL DEFAULT '0' COMMENT '任务完成的数量',
  `task_outtime_date` datetime NOT NULL COMMENT '任务结束时间',
  `task_money_per` double(20,4) NOT NULL DEFAULT '0.0000' COMMENT '每个任务完成的金额',
  `createtime` datetime DEFAULT NULL COMMENT '任务创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

